import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './LoginForm.css';
import logo from "../hit.png"

const LoginForm = () => {
 const navigate = useNavigate();
 const [formData, setFormData] = useState({
   username: '',
   password: '',
 });
 const [error, setError] = useState('');

 const handleSubmit = async (e) => {
   e.preventDefault();
   setError('');

   try {
     const response = await fetch('http://localhost:8000/api/login/', {
       method: 'POST',
       headers: {
         'Content-Type': 'application/json',
         'Accept': 'application/json'
       },
       body: JSON.stringify(formData)
     });

     const data = await response.json();

     if (!response.ok) {
       throw new Error(data.error || 'Login failed');
     }

     localStorage.setItem('access', data.access);
     console.log('Login successful:', data);
     navigate('/menu');
   } catch (err) {
     setError(err.message);
     console.error('Login error:', err);
   }
 };

 const handleChange = (e) => {
   const { name, value } = e.target;
   setFormData(prev => ({
     ...prev,
     [name]: value
   }));
 };

 return (
  <div className="page-wrapper">
    <nav className="navbar">
      <div className="nav-container">
        <div className="nav-brand">
          <img src={logo} alt="Logo" className="nav-logo hover-effect" onClick={() => navigate('/')} />
        </div>
        <div className="nav-links">
          <button 
            onClick={() => navigate('/about')}
            className="nav-link hover-effect"
          >
            About Us
          </button>
        </div>
      </div>
    </nav>

    <div className="login-container">
      <div className="login-card glass-effect">
        <div className="login-header">
          <h2 className="login-title">Welcome Back</h2>
          <p className="login-subtitle">Please enter your credentials to continue</p>
        </div>
        
        {error && <div className="login-error shake">{error}</div>}
        
        <form onSubmit={handleSubmit} className="login-form">
          <div className="input-group">
            <label htmlFor="username">Username</label>
            <input
              id="username"
              type="text"
              name="username"
              placeholder="Enter your username"
              value={formData.username}
              onChange={handleChange}
              className="login-input"
            />
          </div>
          
          <div className="input-group">
            <label htmlFor="password">Password</label>
            <input
              id="password"
              type="password"
              name="password"
              placeholder="Enter your password"
              value={formData.password}
              onChange={handleChange}
              className="login-input"
            />
          </div>

          <button type="submit" className="login-button pulse">
            Login
          </button>
        </form>

        <div className="login-footer">
          <button 
            onClick={() => navigate('/forgot-password')}
            className="forgot-password-link"
          >
            Forgot Password?
          </button>
          
          <div className="register-prompt">
            <span>Don't have an account?</span>
            <button 
              onClick={() => navigate('/register')}
              className="register-link"
            >
              Register here
            </button>
          </div>
        </div>
      </div>
    </div>
  </div>
);
};
